<style>
    @page {
        size: 297mm 167mm;
        margin: 0;
        padding: 0;
    }

    /* Just basic styling */

    .page {
        page-break-after: always;
        margin: 0;
        padding: 8mm 16mm;
    }

    html {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
    }

    body {
        padding: 0;
        margin: 0;
        color: #FFFFFF;
        background-color: #003A70;
        font-family: 'Inter', sans-serif;
    }

    *, *:before, *:after {
        box-sizing: inherit;
    }

    h1 {
        font-family: 'Poppins', sans-serif;
        font-weight: 300;
        font-size: 42px;
        line-height: 54px;
    }

    h3.line-header {
        margin-top: 15px;
        margin-right: 5px;
        display: inline;
        z-index: 100;
        float: left;
        clear: left;
        font-weight:bold;
        font-size:18px
    }

    h3.line-header::after {
        position:absolute;
        content:'\00a0';
        width: 90%;
        margin-top: -12px;
        margin-left: 5px;
        border-bottom: 1px solid #7574BD;
        z-index: 0;
    }

    h4 { font-size:14px; }
    p { font-size: 13px; line-height: 16px; }
    p.small { font-size: 11px; line-height: 14px; }
    .first-description {
        line-height: 20px;
    }
    p.small-cashflow { font-size: 10px; line-height: 14px; }
    h4.key-considerations { font-size:16px; }
    .age {
        font-size: 16px;
        font-weight: bold;
    }
    h4.average-life {
        font-size: 12px;
    }

    .section-right-border {
        border-right: 1px solid #7574BD;
    }
    .section-left-border {
        border-left: 1px solid #7574BD;
    }
    p.small-holistic-approach {
        font-size: 11px;
        line-height: 18px;
    }
    a.learn-more {
        font-family: 'Inter';
        font-size: 10px;
    }
</style>


